import FootNav from "./06_FootNav";
import FooterBottom from "./07_FooterBottom";



const FooterWrap = () => {
    
    return (
        <div className="footer">
        
                <FootNote />
                <FootNav />
                <FooterBottom />
        </div>
    )
}
export default FooterWrap
